(21, 1, '2024-01-31 01:37:20', '2024-01-31 07:37:20', 'The compact version of the WP Distrib logo, showcasing our partnership with WordPress through a penguin mascot and the WordPress emblem, designed for footer placement to ensure brand recognition across our website.', 'WP Distrib - WordPress Solutions Tailored for You', 'WP Distrib\'s Commitment in a Miniature Logo', 'inherit', 'open', 'closed', '', 'wp-distrib-mini-footer-logo', '', '', '2024-01-31 01:37:43', '2024-01-31 07:37:43', '', 0, 'https://x6.4.2.wpdistrib.com/wp-content/uploads/2024/01/wp-distrib-mini-footer-logo.png', 0, 'attachment', 'image/png', 0),
(23, 1, '2024-02-01 04:17:35', '2024-02-01 10:17:35', 'This image is of the Admin Mode icon for the WPDistrib WordPress distribution, featuring a trio of interlocking gears within the well-known WPDistrib logo. The gears symbolize the intricate settings and control mechanisms available in the Admin Mode, emphasizing the robust management tools provided by WPDistrib for WordPress administrators.', 'WPDistrib Admin Mode Icon for WordPress', 'Icon representing the Admin Mode of the WPDistrib WordPress distribution platform.', 'inherit', 'open', 'closed', '', 'wpdistrib-wordpress-admin-mode-icon', '', '', '2024-02-01 04:18:01', '2024-02-01 10:18:01', '', 0, 'https://x6.4.2.wpdistrib.com/wp-content/uploads/2024/02/wpdistrib-wordpress-admin-mode-icon.png', 0, 'attachment', 'image/png', 0),
